import React from 'react';

class SearchBar extends React.Component{

    onInputChange(event){
        console.log(event);
    }

    render(){
        return (<div className="ui segment" >
            <form className="ui form " >
            <div className="field">
                <input type="text" placeholder="Type to Search" onChange={this.onInputChange}/>
             </div>
            </form>
        </div>);
    }

}
export default SearchBar;
